import React from 'react'
import ReactDOM from 'react-dom';
import Nacionalidades from './nacionalidades'

const nacionalidades = [
    "Argentina",
    "Brasil",
    "Chile",
    "Paraguay",
    "Uruguay",
  ];

class Form extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            nombre: '', 
            apellido: '',
            email: '',
            user: '',
            pass: '',
            fecha_nac: '',
            nacionalidad: ''};


        this.handleInputChange = this.handleInputChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);

    }

    handleInputChange(event) {
        const name = event.target.name;
        this.setState({
            [name]: event.target.value
        });
    }

    handleSubmit(event) {
        console.log(this.state)
        alert(
            'Se cargaron los siguientes datos: Nombre: ' + this.state.nombre + 
            ', Apellido ' + this.state.apellido + 
            ', email: ' + this.state.email + 
            ', Nombre de Usuario: ' + this.state.user +
            ', Fecha de Nacimiento: ' + this.state.fecha_nac +
            ', Nacionalidad: ' + this.state.nacionalidad);
        event.preventDefault();
    }

    render() {
        return(
            <form class="form-group" onSubmit={this.handleSubmit}>
                <label>
                    Nombre: 
                    <input id="nombre" class="form-control" name="nombre" type="text" value={this.state.name} onChange={this.handleInputChange} />
                </label>
                <label>
                    Apellido: 
                    <input id="apellido" class="form-control" name="apellido" type="text" value={this.state.apellido} onChange={this.handleInputChange} /> 
                </label>
                <label>
                    email:
                    <input type="email" class="form-control" name="email" value={this.state.email} onChange={this.handleInputChange} />
                </label>
                <label>
                    Usuario:
                    <input type="text" class="form-control" name="user" value={this.state.user} onChange={this.handleInputChange} />
                </label>
                <label>
                    Contrase√±a:
                    <input type="password" class="form-control" name="pass" value={this.state.pass} onChange={this.handleInputChange} /> 
                </label>
                <label>
                    Fecha de Nacimiento:
                    <input type="text" class="form-control" name="fecha_nac" value={this.state.fecha_nac} onChange={this.handleInputChange} /> 
                </label>
                <label>
                    <select name="nacionalidad" class="form-control" id="nac" value={this.state.nacionalidad} onChange={this.handleInputChange}>
                        <Nacionalidades nacionalidades={nacionalidades} />
                    </select>
                </label>
                <input type="submit" class="btn btn-primary" value="Enviar" />

            </form>
        );
    }
}

export default Form;
